import React from 'react';

function Cafe(props) {
    const myStyle = {
        justifyContent: 'center',
        alignItems: 'center',
        width: '300px',
        height: '300px',
        fontSize: '23px',
        marginLeft: '300px'
    }
    return (
        <div className="cafe" style={myStyle}>
            <img style={myStyle} src="" alt=""/>
            <p style={myStyle}>
                Welcome to cafe its place to
                meeting with workers and friend
            </p>
        </div>
    );
}

export default Cafe;
